    es: "SELECCIONAR FRECUENCIA DE MUESTREO Y BITS POR MUESTRA (Chrome OS)\n\nConfigure su dispositivo de entrada de audio (UMIK-2) utilizando las instrucciones a continuación para asegurarse de que coincida con la configuración requerida:\nFrecuencia de Muestreo: 111 Hz\nBits por Muestra: 222 bits\n\nA diferencia de macOS o Windows, Chrome OS no tiene utilidades integradas para ajustar la frecuencia de muestreo o la profundidad de bits. Depende de las configuraciones predeterminadas proporcionadas por el dispositivo de audio conectado. Se recomienda preconfigurar su micrófono UMIK-2 en un sistema compatible (por ejemplo, macOS o Windows) antes de conectarlo a su Chromebook.\n\nUna vez configurado, regrese a esta página web y haga clic en CONTINUAR o presione RETURN.\n\n(La frecuencia de muestreo y la profundidad de bits requeridas están establecidas por los parámetros _calibrateSoundSamplingDesiredHz y _calibrateSoundSamplingDesiredBits en la hoja de cálculo del experimento.)",
