      "⚠ 檢查清單\n1. 看上面：我們使用的揚聲器和麥克風是否正確？\n2. 🔊 電腦音量應調至最大。\n3. 應取下並斷開所有耳機/耳塞的連接。\n對於任何問題，只需單擊“重新記錄”，修復它，然後繼續。",
    hr: "⚠ KONTROLNI POPIS\n1. Pogledajte iznad: Koristimo li prave zvučnike i mikrofon?\n2. 🔊 Glasnoća zvuka računala trebala bi biti maksimalna.\n3. Sve slušalice/bubice treba ukloniti i odspojiti.\nZa bilo kakav problem, samo kliknite PONOVNO SNIMITE, popravite ga i NASTAVI.",
    cs: "⚠ KONTROLNÍ SEZNAM\n1. Podívejte se výše: Používáme správné reproduktory a mikrofon?\n2. 🔊 Hlasitost zvuku počítače by měla být maximální.\n3. Všechna sluchátka by měla být odstraněna a odpojena.\nV případě jakéhokoli problému stačí kliknout na ZNOVU ZÁZNAM, opravit jej a POKRAČOVAT.",
    da: "⚠ CHECKLISTE\n1. Se ovenfor: Bruger vi de rigtige højttalere og mikrofon?\n2. 🔊 Computerens lydstyrke skal være maksimalt.\n3. Eventuelle hovedtelefoner/øretelefoner skal fjernes og frakobles.\nFor ethvert problem skal du blot klikke på RE-RECORD, reparere det og FORTSÆT.",
    nl: "⚠ CHECKLIST\n1. Kijk hierboven: gebruiken we de juiste luidsprekers en microfoon?\n2. 🔊 Het geluidsvolume van de computer moet op maximaal staan.\n3. Eventuele koptelefoons/oordopjes moeten worden verwijderd en losgekoppeld.\nVoor elk probleem klikt u gewoon op OPNIEUW OPNEMEN, repareert u het en gaat u door.",
    "en-UK": "Loading...",
    fi: "⚠ TARKISTUSLISTA\n1. Katso yllä: Käytämmekö oikeita kaiuttimia ja mikrofonia?\n2. 🔊 Tietokoneen äänenvoimakkuuden tulee olla maksimissaan.\n3. Kaikki kuulokkeet/nappikuulokkeet tulee poistaa ja irrottaa.\nJos sinulla on ongelmia, napsauta TALLENNA UUDELLEEN, korjaa se ja JATKA.",
    fr: "Loading...",
    de: "⚠ CHECKLISTE\n1. Schauen Sie oben: Verwenden wir die richtigen Lautsprecher und das richtige Mikrofon?\n2. 🔊 Die Lautstärke des Computertons sollte auf Maximum eingestellt sein.\n3. Alle Kopfhörer/Ohrhörer sollten entfernt und getrennt werden.\nKlicken Sie bei jedem Problem einfach auf NEU AUFZEICHNEN, beheben Sie das Problem und FAHREN SIE FORT.",
    el: "⚠ ΛΙΣΤΑ ΕΛΕΓΧΟΥ\n1. Κοιτάξτε παραπάνω: Χρησιμοποιούμε τα σωστά μεγάφωνα και μικρόφωνο;\n2. 🔊 Η ένταση του ήχου του υπολογιστή πρέπει να είναι στο μέγιστο.\n3. Τυχόν ακουστικά/ψείρες θα πρέπει να αφαιρεθούν και να αποσυνδεθούν.\nΓια οποιοδήποτε πρόβλημα, απλώς κάντε κλικ στην ΕΓΓΡΑΦΗ, διορθώστε το και ΣΥΝΕΧΙΣΤΕ.",
    he: "⚠ רשימת ביקורת\n1. הסתכל למעלה: האם אנחנו משתמשים ברמקולים ובמיקרופון הנכונים?\n2. 🔊 עוצמת הקול של המחשב צריכה להיות מקסימלית.\n3. יש להסיר ולנתק כל אוזניות/אוזניות.\nלכל בעיה, פשוט לחץ על הקלט מחדש, תקן אותה והמשך.",
    hi: "⚠ चेकलिस्ट\n1. ऊपर देखें: क्या हम सही लाउडस्पीकर और माइक्रोफ़ोन का उपयोग कर रहे हैं?\n2. 🔊कंप्यूटर की ध्वनि की मात्रा अधिकतम होनी चाहिए।\n3. किसी भी हेडफ़ोन/ईयरबड को हटा दिया जाना चाहिए और डिस्कनेक्ट कर दिया जाना चाहिए।\nकिसी भी समस्या के लिए, बस री-रिकॉर्ड पर क्लिक करें, इसे ठीक करें और आगे बढ़ें।",
    hu: "⚠ ELLENŐRZŐ LISTA\n1. Nézze meg fent: Megfelelő hangszórókat és mikrofont használunk?\n2. 🔊 A számítógép hangereje legyen maximumon.\n3. Minden fejhallgatót/fülhallgatót el kell távolítani és le kell választani.\nBármilyen probléma esetén kattintson az ÚJRAFELVÉTEL gombra, javítsa ki, és FOLYTATJA.",
    is: "⚠ GÉTSLISTI\n1. Horfðu að ofan: Erum við að nota rétta hátalara og hljóðnema?\n2. 🔊 Hljóðstyrkur tölvunnar ætti að vera í hámarki.\n3. Öll heyrnartól/eyrnatól ætti að fjarlægja og aftengja.\nFyrir hvaða vandamál sem er, smelltu bara á RE-RECORD, lagaðu það og ÁFRAM.",
