    el: "Απλώς γυρίστε και θα βρούμε την απόσταση θέασής σας! Όταν σας ζητηθεί, παραχωρήστε πρόσβαση στην κάμερά σας.",
    he: "פשוט תסתובב ואנו נמצא את מרחק הצפייה שלך! כשתתבקש, אנא הענק גישה למצלמה שלך.",
    hi: "बस चारों ओर मुड़ें, और हम आपकी देखने की दूरी का पता लगा लेंगे! पूछे जाने पर, कृपया अपने कैमरे तक पहुंच प्रदान करें।",
    hu: "Csak forduljon meg, és megkeressük a látótávolságát! Kérésre adjon hozzáférést a kamerához.",
    is: "Snúðu þér bara við og við finnum útsýnisfjarlægð þína! Þegar beðið er um það, vinsamlegast veittu aðgang að myndavélinni þinni.",
    id: "Berbalik saja, dan kami akan menemukan jarak pandang Anda! Jika diminta, berikan akses ke kamera Anda.",
    it: "Basta girarti, e troveremo la tua distanza di visione! Quando richiesto, concedi l'accesso alla tua fotocamera.",
    ja: "振り向くだけで視聴距離がわかります。求められたら、カメラへのアクセスを許可してください。",
    kn: "ತಿರುಗಿ, ಮತ್ತು ನಿಮ್ಮ ವೀಕ್ಷಣಾ ದೂರವನ್ನು ನಾವು ಕಂಡುಕೊಳ್ಳುತ್ತೇವೆ! ಕೇಳಿದಾಗ, ದಯವಿಟ್ಟು ನಿಮ್ಮ ಕ್ಯಾಮರಾಗೆ ಪ್ರವೇಶವನ್ನು ನೀಡಿ.",
    ko: "그냥 돌아서시면 시청 거리를 찾아드립니다! 메시지가 표시되면 카메라에 대한 액세스 권한을 부여하세요.",
    lt: "Tiesiog apsisukite ir mes surasime jūsų žiūrėjimo atstumą! Kai bus paprašyta, suteikite prieigą prie fotoaparato.",
    ms: "Hanya berpaling, dan kami akan mencari jarak tontonan anda! Apabila diminta, sila berikan akses kepada kamera anda.",
    ml: "തിരിയുക, നിങ്ങളുടെ കാഴ്ച ദൂരം ഞങ്ങൾ കണ്ടെത്തും! ആവശ്യപ്പെടുമ്പോൾ, നിങ്ങളുടെ ക്യാമറയിലേക്ക് ആക്‌സസ് അനുവദിക്കുക.",
    no: "Bare snu, så finner vi visningsavstanden din! Når du blir spurt, vennligst gi tilgang til kameraet ditt.",
    fa: "فقط بچرخید و ما فاصله دید شما را پیدا خواهیم کرد! در صورت درخواست، لطفاً اجازه دسترسی به دوربین خود را بدهید.",
    pl: "Po prostu odwróć się, a my obliczymy Twoją odległość oglądania! Gdy zostaniesz o to poproszony, zezwól na dostęp do swojej kamery.",
    pt: "Basta virar-se e encontraremos a sua distância de visualização! Quando solicitado, conceda acesso à sua câmera.",
    ro: "Doar întoarceți-vă și vă vom găsi distanța de vizionare! Când vi se cere, vă rugăm să acordați acces la camera dvs.",
    ru: "Просто обернитесь, и мы найдем расстояние вашего просмотра! При появлении запроса предоставьте доступ к камере.",
    sr: "Само се окрените и ми ћемо пронаћи вашу удаљеност гледања! Када се то од вас затражи, дозволите приступ својој камери.",
    es: "Simplemente date la vuelta, y encontraremos tu distancia de visualización. Cuando se te pida, por favor concede acceso a tu cámara.",
    sw: "Geuka tu, na tutapata umbali wako wa kutazama! Unapoulizwa, tafadhali toa ufikiaji wa kamera yako.",
    sv: "Vänd dig bara om så hittar vi ditt synavstånd! När du tillfrågas, vänligen ge åtkomst till din kamera.",
    tl: "Lumiko ka lang, at makikita namin ang iyong viewing distance! Kapag tinanong, mangyaring magbigay ng access sa iyong camera.",
