    ko: '하단 메뉴에서 "O" 로고를 탭하여 오페라 메뉴를 엽니다. 페이지를 새로 고치려면 주소 표시줄의 새로 고침 아이콘 ⟳을 탭하세요.',
    lt: "Norėdami atidaryti „Opera“ meniu, apatiniame meniu bakstelėkite „O“ logotipą. Norėdami atnaujinti puslapį, adreso juostoje palieskite atnaujinimo piktogramą ⟳.",
    ms: "Di luar 111 cm, lebih sulit untuk mencapai papan ketik komputer Anda, jadi silakan gunakan keypad di smartphone Anda sebagai gantinya.",
