    no: 'Trykk på "O"-logoen i bunnmenyen for å åpne Opera-menyen. For å oppdatere siden, trykk på oppdateringsikonet ⟳ i adressefeltet.',
    fa: "بیش از ۱۱۱ سانتیمتر، دسترسی به صفحه کلید کامپیوتر سخت‌تر می‌شود، بنابراین از صفحه کلید گوشی هوشمند خود استفاده کنید.",
    pl: "Kliknij logo „O” w dolnym menu, aby otworzyć menu Opery. Aby odświeżyć stronę, dotknij ikony odświeżania ⟳ w pasku adresu.",
    pt: "Toque no logotipo “O” no menu inferior para abrir o menu Opera. Para atualizar a página, toque no ícone de atualização ⟳ na barra de endereço.",
    ro: "După 111 cm, este mai dificil să ajungi la tastatura calculatorului, așa că nu ezita să folosești tastatura de pe smartphone-ul tău în schimb.",
    ru: "За пределами 111 см становится сложнее достать до клавиатуры компьютера, поэтому не стесняйтесь использовать клавиатуру на своем смартфоне вместо этого.",
    sr: "Preko 111 cm, teže je dosegnuti tastaturu računara, pa slobodno koristite tastaturu na svom pametnom telefonu umesto toga.",
    es: 'Toque el logotipo de "O" en el menú inferior para abrir el menú de Opera. Para actualizar la página, toque el icono de actualización ⟳ en la barra de direcciones.',
    sw: 'Gonga nembo ya "O" kwenye menyu ya chini ili kufungua menyu ya Opera. Ili kuonyesha upya ukurasa, gusa aikoni ya kuonyesha upya ⟳ katika upau wa anwani.',
    sv: 'Tryck på "O"-logotypen i bottenmenyn för att öppna Opera-menyn. För att uppdatera sidan, tryck på uppdateringsikonen ⟳ i adressfältet.',
    tl: "Sa higit sa 111 cm, mas mahirap na maabot ang keyboard ng iyong computer, kaya maaari kang gumamit ng keypad sa iyong smartphone sa halip.",
    tr: "Opera menüsünü açmak için alt menüdeki “O” logosuna dokunun. Sayfayı yenilemek için adres çubuğundaki yenileme simgesine ⟳ dokunun.",
