    lt: "Norėdami atskleisti adreso juostą, apatiniame meniu bakstelėkite „…“ arba „≡“. Norėdami atnaujinti puslapį, adreso juostoje palieskite atnaujinimo piktogramą ⟳.",
    ms: "Di luar 111 cm, lebih sulit untuk mencapai papan ketik komputer Anda, jadi silakan gunakan keypad di smartphone Anda sebagai gantinya.",
