    no: "For å vise adressefeltet, trykk på “…” eller “≡” i bunnmenyen. For å oppdatere siden, trykk på oppdateringsikonet ⟳ i adressefeltet.",
    fa: "بیش از ۱۱۱ سانتیمتر، دسترسی به صفحه کلید کامپیوتر سخت‌تر می‌شود، بنابراین از صفحه کلید گوشی هوشمند خود استفاده کنید.",
    pl: "Aby wyświetlić pasek adresu, dotknij „…” lub „≡” w dolnym menu. Aby odświeżyć stronę, dotknij ikony odświeżania ⟳ w pasku adresu.",
    pt: "Para revelar a barra de endereço, toque em “…” ou “≡” no menu inferior. Para atualizar a página, toque no ícone de atualização ⟳ na barra de endereço.",
    ro: "După 111 cm, este mai dificil să ajungi la tastatura calculatorului, așa că nu ezita să folosești tastatura de pe smartphone-ul tău în schimb.",
    ru: "За пределами 111 см становится сложнее достать до клавиатуры компьютера, поэтому не стесняйтесь использовать клавиатуру на своем смартфоне вместо этого.",
    sr: "Preko 111 cm, teže je dosegnuti tastaturu računara, pa slobodno koristite tastaturu na svom pametnom telefonu umesto toga.",
    es: 'Para revelar la barra de direcciones, toca "…" o "≡" en el menú inferior. Para actualizar la página, toca el icono de actualización ⟳ en la barra de direcciones.',
    sw: "Ili kuonyesha upau wa anwani, gusa “…” au “≡” kwenye menyu ya chini. Ili kuonyesha upya ukurasa, gusa aikoni ya kuonyesha upya ⟳ katika upau wa anwani.",
    sv: 'För att visa adressfältet, tryck på "..." eller "≡" i bottenmenyn. För att uppdatera sidan, tryck på uppdateringsikonen ⟳ i adressfältet.',
    tl: "Sa higit sa 111 cm, mas mahirap na maabot ang keyboard ng iyong computer, kaya maaari kang gumamit ng keypad sa iyong smartphone sa halip.",
    tr: "Adres çubuğunu ortaya çıkarmak için alt menüdeki “…” veya “≡” öğesine dokunun. Sayfayı yenilemek için adres çubuğundaki yenileme simgesine ⟳ dokunun.",
    ur: 'ایڈریس بار کو ظاہر کرنے کے لیے، نیچے والے مینو میں "…" یا "≡" کو تھپتھپائیں۔ صفحہ کو ریفریش کرنے کے لیے، ایڈریس بار میں ریفریش آئیکن ⟳ کو تھپتھپائیں۔',
