    de: "Leider konnte der QR-Code nicht angezeigt werden. Aktualisieren Sie die Seite für einen weiteren Versuch. Um die Seite zu aktualisieren, tippen Sie auf das Aktualisierungssymbol ⟳ in der Adressleiste. Wenn das Problem weiterhin besteht, klicken Sie unten auf die Schaltfläche „KEINE VERBINDUNG ÜBER QR-CODE HERSTELLEN“.",
