    lt: "⚠ Kadangi šiuo tyrimu bus kalibruojami mikrofonai (_calibrateSoundMicrophonesBool==TRUE), jums reikės USB mikrofono (miniDSP UMIK-1 arba UMIK-2), kad sukalibruotumėte garsiakalbius.",
