    nl: "Loading...",
    "en-UK":
      "3. SET UP MICROPHONE.  \n a. Spread the three tripod legs as far as they will go.  \n b. The tripod's microphone clip is on a swivel. Swivel the clip all the way to whichever side makes the highest edge of the clip higher.  \n c. Insert the microphone into the tripod clip, from below, until the microphone's bottom end is flush with the lowest edge of the clip.  \n d. Adjust tilt to make the microphone vertical, pointing up to the ceiling.  \n e. Place the tripod on the table between you and your computer. Rotate the tripod to bring the microphone to your side.  \n f. Push the tripod towards your computer (or whatever has the speakers) until the tripod's far two legs nearly touch it, and the third leg is near you.  \n4. A PROCEED button will appear below. Click it to start calibrating.",
    fi: "Loading...",
    fr: "3. INSTALLER LE MICROPHONE.  \n a. Écartez les trois pieds du trépied autant que possible.  \n b. Le clip de microphone du trépied est sur un pivot. Faites pivoter le clip jusqu'à ce que le bord le plus haut du clip soit le plus élevé.  \n c. Insérez le microphone dans le clip du trépied, par en dessous, jusqu'à ce que l'extrémité inférieure du microphone soit à ras du bord le plus bas du clip.  \n d. Ajustez l'inclinaison pour que le microphone soit vertical, pointant vers le plafond.  \n e. Placez le trépied sur la table entre vous et votre ordinateur. Faites pivoter le trépied pour amener le microphone de votre côté.  \n f. Poussez le trépied vers votre ordinateur (ou tout autre appareil avec des haut-parleurs) jusqu'à ce que les deux pieds éloignés du trépied le touchent presque, et que le troisième pied soit près de vous.  \n4. Un bouton PROCÉDER apparaîtra en dessous. Cliquez dessus pour commencer l'étalonnage.",
    de: "Loading...",
    el: "Loading...",
    he: "Loading...",
    hi: "Loading...",
    hu: "Loading...",
    is: "Loading...",
    id: "Loading...",
    it: "3. CONFIGURARE IL MICROFONO. \n a. Allargare le tre gambe del treppiede il più possibile. \n b. La clip del microfono del treppiede è su un perno. Ruotare la clip completamente verso il lato che rende il bordo più alto della clip più alto. \n c. Inserire il microfono nella clip del treppiede, dal basso, fino a quando l'estremità inferiore del microfono è a filo con il bordo più basso della clip. \n d. Regolare l'inclinazione per rendere il microfono verticale, puntando verso il soffitto. \n e. Posizionare il treppiede sul tavolo tra te e il tuo computer. Ruotare il treppiede per portare il microfono dalla tua parte. \n f. Spingere il treppiede verso il computer (o qualunque cosa abbia gli altoparlanti) fino a quando le due gambe lontane del treppiede quasi lo toccano, e la terza gamba è vicino a te.\n4. Apparirà un pulsante PROCEED qui sotto. Cliccalo per iniziare la calibrazione.",
