    es: "3. CONFIGURAR MICRÓFONO. \n a. Extienda las tres patas del trípode tanto como sea posible. \n b. El clip del micrófono del trípode está en un pivote. Gire el clip completamente hacia el lado que haga que el borde más alto del clip sea más alto. \n c. Inserte el micrófono en el clip del trípode, desde abajo, hasta que el extremo inferior del micrófono esté al ras con el borde más bajo del clip. \n d. Ajuste la inclinación para que el micrófono esté vertical, apuntando hacia el techo. \n e. Coloque el trípode en la mesa entre usted y su computadora. Gire el trípode para llevar el micrófono a su lado. \n f. Empuje el trípode hacia su computadora (o lo que sea que tenga los altavoces) hasta que las dos patas más alejadas del trípode casi lo toquen, y la tercera pata esté cerca de usted.\n4. Aparecerá un botón de PROCEDER abajo. Haga clic en él para comenzar a calibrar.",
