    "zh-HK":
      "1. 🔊 最大音量。為了獲得準確的聲音，請立即將電腦的音量調至最大，然後在會話結束之前不要觸摸音量。\n2. 沒有耳機。取下並斷開所有耳機/耳塞，因為它們會使聲音不準確。",
    hr: "1. 🔊 MAKSIMALNI VOLUME. Za točan zvuk, maksimalno povećajte glasnoću zvuka vašeg računala sada, a zatim ne dirajte glasnoću dok sesija ne završi.\n2. BEZ SLUŠALICA. Uklonite i odspojite sve slušalice/bubice jer bi zvuk bio netočan.",
    cs: "1. 🔊 MAXIMÁLNÍ OBJEM. Pro přesný zvuk prosím nyní maximalizujte hlasitost zvuku počítače a poté se nedotýkejte hlasitosti, dokud relace neskončí.\n2. ŽÁDNÁ SLUCHÁTKA. Odstraňte a odpojte všechna sluchátka / špunty, protože by zvuk byl nepřesný.",
    da: "1. 🔊 MAX LYDSTYRKE. For nøjagtig lyd skal du maksimere din computers lydstyrke nu og derefter ikke røre ved lydstyrken, før sessionen slutter.\n2. INGEN HOVEDTELEFONER. Fjern og frakobl eventuelle hovedtelefoner/øretelefoner, da de ville gøre lyden unøjagtig.",
    nl: "1. 🔊MAXIMUMVOLUME. Voor een nauwkeurig geluid maximaliseert u nu het geluidsvolume van uw computer en raakt u het volume pas aan als de sessie is afgelopen.\n2. GEEN HOOFDTELEFOONS. Verwijder eventuele koptelefoons/oordopjes en koppel deze los, omdat deze het geluid onnauwkeurig zouden maken.",
    "en-UK": "Loading...",
    fi: "1. 🔊 MAX VOLUME. Tarkka äänen saamiseksi maksimoi tietokoneesi äänenvoimakkuus nyt ja älä kosketa äänenvoimakkuutta ennen kuin istunto on päättynyt.\n2. EI KUULOKKEITA. Irrota ja irrota kuulokkeet/nappikuulokkeet, koska ne tekisivät äänestä epätarkan.",
    fr: "Loading...",
    de: "1. 🔊 MAXIMALE LAUTSTÄRKE. Für einen präzisen Klang maximieren Sie bitte jetzt die Lautstärke Ihres Computers und regeln Sie die Lautstärke dann nicht, bis die Sitzung beendet ist.\n2. KEINE KOPFHÖRER. Entfernen und trennen Sie alle Kopfhörer/Ohrhörer, da diese den Ton ungenau machen würden.",
    el: "1. 🔊 ΜΕΓΙΣΤΟΣ ΟΓΚΟΣ. Για ακριβή ήχο, μεγιστοποιήστε την ένταση ήχου του υπολογιστή σας τώρα και, στη συνέχεια, μην αγγίζετε την ένταση μέχρι να τελειώσει η περίοδος λειτουργίας.\n2. ΟΧΙ ΑΚΟΥΣΤΙΚΑ. Αφαιρέστε και αποσυνδέστε τυχόν ακουστικά/ ακουστικά, γιατί θα έκαναν τον ήχο ανακριβή.",
    he: "1. 🔊 נפח מקסימלי. לקבלת צליל מדויק, נא למקסם את עוצמת הקול של המחשב כעת, ולאחר מכן אל תיגע בעוצמת הקול עד שההפעלה תסתיים.\n2. ללא אוזניות. הסר ונתק אוזניות/אוזניות כלשהן, כי הן יגרמו לצליל להיות לא מדויק.",
