    el: '1. Εάν ένα αναδυόμενο παράθυρο ζητήσει την άδειά σας για χρήση του μικροφώνου, κάντε κλικ στο "Να επιτρέπεται".\n2. Κάντε κλικ στο "Συνέχεια" ή πατήστε RETURN.',
    he: '1. אם חלון קופץ מבקש את רשותך להשתמש במיקרופון, לחץ על "אפשר".\n2. לחץ על "המשך" או הקש על RETURN.',
    hi: '1. यदि कोई पॉप अप आपसे माइक्रोफ़ोन का उपयोग करने की अनुमति मांगता है, तो "अनुमति दें" पर क्लिक करें।\n2. "आगे बढ़ें" पर क्लिक करें या रिटर्न दबाएँ।',
