    kn: "1. ಈ ಫೋನ್ ಅನ್ನು ನೀವು ರಚಿಸಿದ ಪ್ಲಾಟ್‌ಫಾರ್ಮ್‌ನಲ್ಲಿ ಇರಿಸಿ, ಉದಾಹರಣೆಗೆ ಗಾಜು, ಮಗ್ ಅಥವಾ ಕ್ಯಾನ್. \n2. ಕೆಳಗಿನ ಸೂಚನೆಗಳನ್ನು ಓದಲು ನನ್ನನ್ನು ತಿರುಗಿಸಿ.",
    ko: "1. 유리잔, 머그잔, 캔 등 자신이 만든 플랫폼 위에 이 전화기를 놓습니다. \n2. 나를 회전시켜 아래 지침을 읽어보세요.",
    lt: "1. Padėkite šį telefoną ant savo sukurtos platformos, pvz., stiklinės, puodelio ar skardinės. \n2. Pasukite mane, kad perskaitytumėte toliau pateiktas instrukcijas.",
    ms: "Di luar 111 cm, lebih sulit untuk mencapai papan ketik komputer Anda, jadi silakan gunakan keypad di smartphone Anda sebagai gantinya.",
    ml: "1. ഗ്ലാസ്, മഗ് അല്ലെങ്കിൽ ക്യാൻ പോലുള്ള നിങ്ങൾ സൃഷ്ടിച്ച പ്ലാറ്റ്‌ഫോമിൽ ഈ ഫോൺ ഇടുക. \n2. ചുവടെയുള്ള നിർദ്ദേശങ്ങൾ വായിക്കാൻ എന്നെ തിരിക്കുക.",
    no: "1. Sett denne telefonen på plattformen du har laget, for eksempel et glass, krus eller boks. \n2. Roter meg for å lese instruksjonene nedenfor.",
    fa: "بیش از ۱۱۱ سانتیمتر، دسترسی به صفحه کلید کامپیوتر سخت‌تر می‌شود، بنابراین از صفحه کلید گوشی هوشمند خود استفاده کنید.",
    pl: "1. Połóż telefon na utworzonej przez siebie platformie, np. szklance, kubku lub puszce. \n2. Obróć mnie, aby przeczytać poniższe instrukcje.",
    pt: "1. Coloque este telefone na plataforma que você criou, como um copo, uma caneca ou uma lata. \n2. Gire-me para ler as instruções abaixo.",
    ro: "După 111 cm, este mai dificil să ajungi la tastatura calculatorului, așa că nu ezita să folosești tastatura de pe smartphone-ul tău în schimb.",
    ru: "За пределами 111 см становится сложнее достать до клавиатуры компьютера, поэтому не стесняйтесь использовать клавиатуру на своем смартфоне вместо этого.",
    sr: "Preko 111 cm, teže je dosegnuti tastaturu računara, pa slobodno koristite tastaturu na svom pametnom telefonu umesto toga.",
    es: "1. Coloca este teléfono en la plataforma que creaste, como un vaso, taza o lata.\n2. Gírame para leer las instrucciones a continuación.",
