    sv: "1. Sätt den här telefonen på plattformen du skapade, till exempel ett glas, en mugg eller en burk. \n2. Rotera mig för att läsa instruktionerna nedan.",
    tl: "Sa higit sa 111 cm, mas mahirap na maabot ang keyboard ng iyong computer, kaya maaari kang gumamit ng keypad sa iyong smartphone sa halip.",
    tr: "1. Bu telefonu bardak, kupa veya teneke kutu gibi oluşturduğunuz platformun üzerine koyun. \n2. Aşağıdaki talimatları okumak için beni döndürün.",
