    hi: "माइक्रोफ़ोन अब कैलिब्रेट किया गया है, और प्रोफ़ाइल लाइब्रेरी में जोड़ा गया है। कृपया इसे हटा दें. यदि आप चाहें तो आप अगले माइक्रोफ़ोन को कैलिब्रेट कर सकते हैं।",
