    kn: "ಮೈಕ್ರೊಫೋನ್ ಅನ್ನು ಈಗ ಮಾಪನಾಂಕ ಮಾಡಲಾಗಿದೆ ಮತ್ತು ಪ್ರೊಫೈಲ್ ಲೈಬ್ರರಿಗೆ ಸೇರಿಸಲಾಗಿದೆ. ದಯವಿಟ್ಟು ದೂರ ಹಾಕಿ. ನೀವು ಬಯಸಿದಲ್ಲಿ ನೀವು ಮುಂದಿನ ಮೈಕ್ರೊಫೋನ್ ಅನ್ನು ಮಾಪನಾಂಕ ಮಾಡಬಹುದು.",
