    lt: "Mikrofonas dabar sukalibruotas ir buvo įtrauktas į profilių biblioteką. Prašau padėkite. Jei norite, galite sukalibruoti kitą mikrofoną.",
    ms: "Di luar 111 cm, lebih sulit untuk mencapai papan ketik komputer Anda, jadi silakan gunakan keypad di smartphone Anda sebagai gantinya.",
    ml: "മൈക്രോഫോൺ ഇപ്പോൾ കാലിബ്രേറ്റ് ചെയ്തു, പ്രൊഫൈൽ ലൈബ്രറിയിലേക്ക് ചേർത്തു. ദയവായി അത് മാറ്റിവെക്കുക. നിങ്ങൾക്ക് വേണമെങ്കിൽ അടുത്ത മൈക്രോഫോൺ കാലിബ്രേറ്റ് ചെയ്യാം.",
    no: "Mikrofonen er nå kalibrert, og ble lagt til profilbiblioteket. Vennligst legg den bort. Du kan kalibrere neste mikrofon hvis du vil.",
