    ko: "설문조사에 참여해 주셔서 감사합니다. 종료하지 마십시오. 진행을 누르면 결과를 저장하고 완료 코드를 사용하여 Prolific으로 다시 리디렉션할 수 있습니다. 감사해요.",
    lt: "Dėkojame, kad dalyvaujate mūsų apklausoje. Nenutrauk. Spustelėkite Tęsti, kad galėtume išsaugoti rezultatus ir nukreipti jus atgal į Prolific su užbaigimo kodu. Ačiū.",
