    pl: "Dziękujemy za udział w naszej ankiecie. Nie rezygnuj. Kliknij Kontynuuj, abyśmy mogli zapisać wyniki i przekierować Cię z powrotem do Prolific z kodem ukończenia. Dzięki.",
