    el: "Εάν αυτή η οθόνη παγώσει, επανασυνδεθείτε στρέφοντας την κάμερα του smartphone σας στον κωδικό QR στην οθόνη του υπολογιστή σας. Όταν εμφανιστεί ένας σύνδεσμος, πατήστε τον.",
