      "Connection was lost. Please reconnect by pointing your smartphone camera at the QR code on your computer screen. When a link appears, tap it.",
    ar: "فقد الاتصال. يرجى إعادة الاتصال عن طريق توجيه كاميرا هاتفك الذكي نحو رمز الاستجابة السريعة على شاشة الكمبيوتر. عندما يظهر رابط، اضغط عليه.",
    hy: "Կապը կորել է: Խնդրում ենք նորից միացնել՝ սմարթֆոնի տեսախցիկը ուղղելով համակարգչի էկրանի QR կոդի վրա: Երբ հղումը հայտնվում է, հպեք դրան:",
