    hr: "Veza je prekinuta. Ponovno se povežite usmjeravanjem kamere pametnog telefona prema QR kodu na zaslonu računala. Kada se pojavi poveznica, dodirnite je.",
    cs: "Spojení bylo ztraceno. Znovu se připojte namířením fotoaparátu smartphonu na QR kód na obrazovce počítače. Když se zobrazí odkaz, klepněte na něj.",
