      "Connection was lost. Please reconnect by pointing your smartphone camera at the QR code on your computer screen. When a link appears, tap it.",
    fi: "Yhteys katkesi. Yhdistä uudelleen suuntaamalla älypuhelimen kamera tietokoneen näytöllä olevaan QR-koodiin. Kun linkki tulee näkyviin, napauta sitä.",
