    he: "החיבור אבד. אנא התחבר מחדש על ידי הפניית מצלמת הטלפון החכם שלך אל קוד ה-QR שבמסך המחשב שלך. כשיופיע קישור, הקש עליו.",
    hi: "कनेक्शन टूट गया. कृपया अपने स्मार्टफोन के कैमरे को अपने कंप्यूटर स्क्रीन पर क्यूआर कोड पर इंगित करके पुनः कनेक्ट करें। जब कोई लिंक दिखाई दे तो उस पर टैप करें.",
    hu: "A kapcsolat megszakadt. Kérjük, csatlakozzon újra úgy, hogy okostelefonjának kameráját a számítógép képernyőjén megjelenő QR-kód felé irányítja. Amikor megjelenik egy hivatkozás, koppintson rá.",
