    ko: "연결이 끊어졌습니다. 스마트폰 카메라를 컴퓨터 화면의 QR 코드로 향하게 하여 다시 연결하세요. 링크가 나타나면 해당 링크를 탭하세요.",
    lt: "Ryšys nutrūko. Iš naujo prisijunkite nukreipdami savo išmaniojo telefono kamerą į QR kodą kompiuterio ekrane. Kai pasirodys nuoroda, bakstelėkite ją.",
    ms: "Di luar 111 cm, lebih sulit untuk mencapai papan ketik komputer Anda, jadi silakan gunakan keypad di smartphone Anda sebagai gantinya.",
    ml: "കണക്ഷൻ നഷ്ടപ്പെട്ടു. നിങ്ങളുടെ കമ്പ്യൂട്ടർ സ്‌ക്രീനിലെ QR കോഡിലേക്ക് നിങ്ങളുടെ സ്‌മാർട്ട്‌ഫോൺ ക്യാമറ ചൂണ്ടിക്കാണിച്ച് വീണ്ടും കണക്‌റ്റുചെയ്യുക. ഒരു ലിങ്ക് ദൃശ്യമാകുമ്പോൾ, അതിൽ ടാപ്പുചെയ്യുക.",
