    fi: "Loading...",
    fr: "À chaque essai, pendant que vous regardez la croix, un triplet de trois LLLS aléatoires CLIGNOTERA dans le coin de votre œil. Juste un éclair. Pour apprendre la tâche, essayons d'abord avec un affichage STATIQUE. En regardant la croix, ci-dessous, sans bouger les yeux : Quel est le LLL du milieu ? \n                    +.              2 7 3 \nC'est un 7. Cet affichage est statique, donc il serait facile de déplacer vos yeux vers le LLL et de l'identifier. Mais, dans un essai réel, le LLL CLIGNOTE, donc il n'y a pas de temps pour déplacer vos yeux. Il est important de regarder la croix lorsque vous commencez l'essai. Le LLL clignotera immédiatement. Peu importe où vont vos yeux après le clignotement. Le premier bloc de test est juste quelques essais de pratique, avant de commencer sérieusement.",
