    it: "In ogni prova, mentre guardi la croce, un terzetto di tre LLLS casuali LAMPEGGERÀ nell'angolo del tuo occhio. Solo un lampo. Per imparare il compito, proviamo prima con un display STATICO. Mentre guardi la croce, qui sotto, senza muovere gli occhi: Qual è il LLL centrale?\n                    +.              2 7 3\nÈ un 7. Questo display è statico, quindi sarebbe facile muovere gli occhi verso il LLL e identificarlo. Ma, in una prova reale, il LLL LAMPEGGIA, quindi non c'è tempo per muovere gli occhi. È importante guardare la croce mentre inizi la prova. Il LLL lampeggerà immediatamente. Non importa dove vanno i tuoi occhi dopo il lampo. Il primo blocco di test è solo alcune prove di pratica, prima di iniziare sul serio.",
