    ar: "في كل تجربة، بينما تنظر إلى الصليب، سيظهر بشكل عشوائي LLL في زاوية عينك. مجرد وميض. لتعلم المهمة، دعونا نجربها أولاً مع عرض ثابت. أثناء النظر إلى الصليب، أدناه، دون تحريك عينيك: ما هو LLL؟\n\n             +               R  \n\nإنه R. هذا العرض ثابت، لذا سيكون من السهل تحريك عينيك إلى LLL وتحديده. ولكن، في تجربة حقيقية، يتم وميض LLL، لذا لا يوجد وقت لتحريك عينيك. يرجى النظر إلى الصليب عند بدء التجربة. لا يهم أين تذهب عينيك بعد الوميض. الكتلة الأولى من الاختبار هي مجرد بضع تجارب تدريبية، قبل أن نبدأ بجدية.",
