    ko: "단어를 읽을 준비가 되셨나요? 십자가 중앙을 똑바로 바라보면서 스페이스바를 눌러주세요.",
    lt: "Pasiruošę perskaityti keletą žodžių? Žiūrėdami tiesiai į kryžiaus centrą, paspauskite tarpo klavišą.",
