    hy: "Ողջույն։ Դուք կարող եք ստուգել, ​​թե արդյոք այս համակարգչի ձայնն աշխատում է, սեղմելով BEEP կոճակը: Դուք կլսեք նման ազդանշան ամեն անգամ, երբ ձեր պատասխանը ճիշտ է: ",
    bg: "здравей Можете да проверите дали звукът на този компютър работи, като щракнете върху бутона BEEP. Ще чуете такъв звуков сигнал всеки път, когато отговорът ви е правилен. ",
